import React, {useEffect, useState} from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from './Title';

const useStyles = makeStyles((theme) => ({
    seeMore: {
        marginTop: theme.spacing(3),
    },
}));

export default function CompoundTable() {
    const classes = useStyles();
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);
    let tokens = []
    useEffect(() => {
        fetch("https://api.covalenthq.com/v1/1/networks/compound/assets?key=onemillionwallets")
            .then(res => res.json())
            .then(
                (data) => {
                    setIsLoaded(true);
                    tokens = data.data.items;
                    setItems(data.data.items);
                    console.log(isLoaded)
                    console.log(tokens)
                },

                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
    }, [])
    if (error) {
        return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
        return <div>Loading...</div>;
    } else {
        return (
            <React.Fragment>
                <Title>Compound Dashboard</Title>
                <Table size="small">
                    <TableHead>
                        <TableRow>
                            <TableCell>Assets</TableCell>
                            <TableCell>Symbol</TableCell>
                            <TableCell>Price</TableCell>
                            <TableCell>Borrow APY</TableCell>
                            <TableCell>Supply APY</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {items.map((item, index) => (
                            <TableRow key={index}>
                                <TableCell><img src={item.underlying.logo_url} style={{width: '30px'}}/></TableCell>
                                <TableCell>{item.underlying.contract_ticker_symbol}</TableCell>
                                <TableCell>{item.underlying.quote_rate}</TableCell>
                                <TableCell>{item.borrow_apr}</TableCell>
                                <TableCell>{item.stable_borrow_apr}</TableCell>
                                <TableCell>{item.supply_apy}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </React.Fragment>
        );
    }
}
